<span class="line"><span style="color:#A6ACCD;">ctrl+b </span><span style="color:#89DDFF;">!</span><span style="color:#A6ACCD;">        </span><span style="color:#676E95;">#     \u628A\u5F53\u524D\u7A97\u53E3\u53D8\u4E3A\u65B0\u7A97\u53E3</span></span>
